import React from 'react';
import { withBoostoreService } from '../hoc';
import Content from '../content';

const App = ({ bookstoreService }) => {
    console.log(bookstoreService.getBooks());
    return (
        <Content />
    )       
}

export default withBoostoreService()(App);
